import { StyleSheet} from 'react-native';


const styles = StyleSheet.create({
  container: {
     backgroundColor: '#DA5C5C',
     height:90,
     paddingTop:50,
     flexDirection:'row',
     justifyContent:'center',
  },
  text_logo:{
     color:'#FFF',
     fontSize: 18,
     fontWeight: 'bold',
     lineHeight: 25,
     letterSpacing: -0.24,
     marginLeft:15,
     //fontFamily:' OpenSans_700Bold',
  }
});
export default styles;
